import React, { useState } from 'react';
import './index.css';


const App = () => {

    const state = useState();
    const [count,setCount] = useState(0);

    const InCre = () =>{
        setCount(count++);
    }

    return(
        <>
            <h1>{count}</h1>
            <button onClick={InCre}>Click Me</button>
        </>
    )
};

export default App;
